INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (2834, 40, "青空の下で謁見", 7, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 91002, 8, 1, 20063115, "ペコリーヌとの出会い", 5118061, 10118, 2, 0, "フリーマーケット会場");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (2835, 40, "未来の騎空団\nマスコット？", 7, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 91002, 8, 1, 20063115, "マホとの出会い", 5118062, 10118, 2, 0, "フリーマーケット会場");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (2837, 40, "お嬢さまからの\n緊急依頼", 7, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 91002, 8, 1, 20063115, "アキノとの出会い", 5118063, 10118, 2, 0, "ランドソル市街地");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (4108402, 40, "黄金色の悩みごと", 18, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 91002, 8, 1, 20063115, "ジュンとの出会い", 5118064, 10118, 2, 0, "フリーマーケット会場");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (4107402, 40, "白熱！　格闘大会！", 18, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 91002, 8, 1, 20063115, "カオリとの出会い", 5118065, 10118, 2, 0, "フリーマーケット会場");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (9000227, 40, "祭り太鼓はオーエドの華", 16, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 91002, 8, 1, 20063115, "ニノンとの出会い", 5118066, 10118, 2, 1, "オーエド町");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (2101181, 40, "人気者は遅れて\nやってくる", 19, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 91002, 8, 1, 20063115, "スズナとの出会い", 5118067, 10118, 3, 0, "フリーマーケット会場");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (4109402, 40, "巫女・ミーツ・魔法少女", 18, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 91002, 8, 1, 20063115, "ナナカとの出会い", 5118068, 10118, 3, 0, "ランドソル市街地");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (4305402, 40, "ネズ耳は二度なくなる", 18, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 91002, 8, 1, 20063115, "キャル＆コッコロとの出会い", 5118069, 10118, 3, 0, "フリーマーケット会場");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (4101402, 40, "この出会いにカンパイ！", 18, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 91002, 8, 1, 20063115, "ユカリとの出会い", 5118070, 10118, 3, 0, "ランドソル市街地");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (4106402, 40, "陰陽アンサンブル", 18, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 91002, 8, 1, 20063115, "アオイとの出会い", 5118071, 10118, 3, 0, "ランドソル市街地");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (2836, 40, "運試し十番勝負！", 7, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 91002, 8, 1, 20063115, "シノブとの出会い", 5118072, 10118, 3, 1, "フリーマーケット会場");
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (0, 0, "彼女たちの新たな日常", 0, 0, 0, 0, 0, 20063115, "オープニング", 5118600, 10118, 1, 0, 0);
